const style2 = {
    textAlign: "left",
    fontSize: 30,
    paddingLeft: 100,
    lineHeight:3,

}

const Header = () => {
    return
        <div style={pstyle}>
            <span style={style2}>
                <label style={{color:"white"}}>Food Search</label>
            </span>
        </div>
};

export default Header;
